'use strict';

/**
 * facturacion-sifei service.
 */
var fs = require('fs');
var path = require('path');
var ini = require('ini');
var soap = require('soap');
var unzipper = require('unzipper')
const axios = require('axios');

let HEADERS = {
    headers: {
        "Content-Type": "application/json"
    }
}

module.exports = {
    generarFacturaElec: async (cfdiBase64) => {
        const DIR = './src/api/facturacion-sifei/services/tmp';
        const response = {
            error: "",
            xmlBase64: "",
        }

        const config = strapi.config.get('admin.sifeiSoap', 'defaultValueIfUndefined');
        try {
            //preparamos los parametros de timbrado
            var parametrosDeTimbrado = {
                Usuario: config.user,   //usuario de sifei
                Password: config.pass, //contraseÃ±a
                IdEquipo: config.idEquipo, //id de equipo
                archivoXMLZip: cfdiBase64, //archivo CFDI
                Serie: "",
            };

            const client = await soap.createClientAsync(config.host);
            const responseSOAP = await client.getCFDIAsync(parametrosDeTimbrado);
            const pdfBase64 = responseSOAP[0].return

            let zipP = DIR + '/timbrado.zip';
            //let timbradoDir = path.dirname(zipP).split(path.sep).pop()

            fs.writeFileSync(zipP, pdfBase64, { encoding: 'base64' })

            const unzipXML = await new Promise((resolve, reject) => {
                fs.createReadStream(DIR + '/timbrado.zip')
                    .pipe(unzipper.Extract({
                        path: DIR
                    }))
                    .on('close', () => resolve(true));
            })
            //ahora debemos leer el zip y extraer los archivos(solo es el XML timbrado)
            const fileNameXML = await new Promise((resolve, reject) => {
                fs.createReadStream(DIR + '/timbrado.zip')
                    .pipe(unzipper.Parse())
                    .on('entry', function (entry) {
                        const fileName = entry.path;
                        if (fileName != "") {
                            resolve(fileName)
                        } else {
                            entry.autodrain();
                            reject("")
                        }
                    });
            })

            if (!unzipXML) {
                response.error = "Error al extraer xml"
                return;
            }

            const xmlUnzip = fs.readFileSync('./src/api/facturacion-sifei/services/tmp/' + fileNameXML, 'utf-8');
            let xmlBase64 = (Buffer.from(xmlUnzip, 'utf-8')).toString('base64');
            fs.unlinkSync('./src/api/facturacion-sifei/services/tmp/' + fileNameXML);
            response.xmlBase64 = xmlBase64;
        } catch (error) {
            console.log(error.message)
            response.error = error.message;
        }

        return response;
    },

    getTokenSIFEI: async () => {
        const config = strapi.config.get('admin.sifeiRest', 'defaultValueIfUndefined');
        const data = JSON.stringify({
            rfc: config.user,
            password: config.pass,
        });
        let response = { error: "", token: "" };

        try {
            const callApi = await axios
                .post(config.host + "/validador/auth/signin", data, HEADERS);
            response.token = callApi.data.token;
        } catch (error) {
            if (error.response) {
                response.error = error.response.data;
            }
        }
        return response;
    },

    getXML: async (token, data) => {
        const config = strapi.config.get('admin.sifeiRest', 'defaultValueIfUndefined');
        let response = { error: "", xmlBase64: "", uuid: "" };
        console.log(data);
        try {
            const callApi = await axios
                .post(config.host + "/validador/utils/genera_xml", data,
                    {
                        headers: {
                            "Content-Type": "application/json",
                            'Authorization': 'Bearer ' + token
                        }
                    });
            response.xmlBase64 = callApi.data.data;
            response.uuid = callApi.data.uuid;
        } catch (error) {
            if (error.response) {
                response.error = error.response.data;
            }
        }
        return response
    },

    generatePDF: async (token, xmlBase64) => {

        const config = strapi.config.get('admin.sifeiRest', 'defaultValueIfUndefined');
        let response = { error: "", pdfBase64: "" };

        const data = JSON.stringify({
            "primaryColor": "#A41613",
            "secundaryColor": "#A41613",
            "xml": xmlBase64,
            "logo": "data:image/jpeg;base64,"
        });

        try {
            const callApi = await axios
                .post(config.hostPdf + "/cfdipdf/api/v1/GeneratePDF", data,
                    {
                        headers: {
                            "Content-Type": "application/json",
                            'Authorization': config.pdfToken
                        }
                    });
            console.log(callApi.data);
            response.pdfBase64 = callApi.data.data;
            response.uuid = callApi.data.uuid;
        } catch (error) {
            console.log(error);
            if (error.response) {
                response.error = error.response.data;
            }
        }
        return response
    },

    sendInvoice: async (xml, pdf, UUID, email) => {
        const __dirname = './src/api/facturacion-sifei/services';
        const TEMPLATE = await new Promise((resolve, reject) => {
            fs.readFile(__dirname + "/template.html", function (error, html) {
                if (error) {
                    throw error;
                }
    
                //const user = "Node JS";
               // html = html.replace("{ user }", user);
                resolve(html);
            });
        })

        await strapi.plugin('email').service('email').send({
            to: email,
            from: 'noreply@comercializadora.com',
            subject: 'Usted ha recibido un comprobante fiscal ' + UUID,
            html: TEMPLATE,
            attachments: [
                {   // encoded string as an attachment
                    filename: UUID + '.xml',
                    content: Buffer.from(
                        xml,
                        'base64'
                    )
                },
                {   // encoded string as an attachment
                    filename: UUID + '.pdf',
                    content: Buffer.from(
                        pdf,
                        'base64'
                    ),
                }
            ]
        });
    },

    saveInvoice: async (data) => {
        const invoice = await strapi.entityService.create('api::factura.factura', {
            data: data,
        });
        return invoice
    },
    
}